import React from 'react';

const dataList = [
  { id: 1, avatar: 'avatar1.png', first_name: 'John' },
  { id: 2, avatar: 'avatar2.png', first_name: 'Jane' },
  { id: 3, avatar: 'avatar3.png', first_name: 'Bob' },
  // Add more data items here
];

const ListView = () => {
  return (
    <div>
      {dataList.map((item) => (
        <div key={item.id}>
          <h3>{item.first_name}</h3>
          <img src={item.avatar} alt={item.first_name} />
        </div>
      ))}
    </div>
  );
};

export default ListView;
